// Fetch Delivery data with filtering
async function getDeliveries(supabase, filters = {}) {
    let query = supabase.from('deliveries').select(`
      id,
      delivery_date,
      order_id,
      driver_id,
      status_id,
      status:global_statuses ( id, name ),
      created_at
    `).order('delivery_date', {
        ascending: false
    });
    // Apply filters
    if (filters.orderId) {
        query = query.eq('order_id', filters.orderId);
    }
    if (filters.statusId) {
        query = query.eq('status_id', filters.statusId);
    }
    if (filters.driverId) {
        query = query.eq('driver_id', filters.driverId);
    }
    if (filters.startDate) {
        query = query.gte('delivery_date', filters.startDate);
    }
    if (filters.endDate) {
        query = query.lte('delivery_date', filters.endDate);
    }
    const { data, error } = await query;
    if (error) {
        console.error("Error fetching deliveries:", error);
        return [];
    }
    const mappedData = data?.map((item)=>({
            id: item.id,
            order_id: item.order_id,
            order_ref: `Pedido #${item.order_id?.substring(0, 8)}...`,
            delivery_date: item.delivery_date,
            driver_id: item.driver_id,
            driver_name: `Motorista ${item.driver_id?.substring(0, 5)}...`,
            status_id: item.status_id,
            status_name: item.status?.name || 'Desconhecido',
            created_at: item.created_at
        })) || [];
    return mappedData;
}
// Fetch Delivery Route data with filtering
async function getDeliveryRoutes(supabase, filters = {}) {
    let query = supabase.from('delivery_routes').select(`
      id,
      route_name,
      route_date,
      driver_id,
      created_at
    `).order('route_date', {
        ascending: false
    });
    // Apply filters
    if (filters.routeName) {
        query = query.ilike('route_name', `%${filters.routeName}%`);
    }
    if (filters.driverId) {
        query = query.eq('driver_id', filters.driverId);
    }
    if (filters.startDate) {
        query = query.gte('route_date', filters.startDate);
    }
    if (filters.endDate) {
        query = query.lte('route_date', filters.endDate);
    }
    const { data, error } = await query;
    if (error) {
        console.error("Error fetching delivery routes:", error);
        return [];
    }
    const mappedData = data?.map((item)=>({
            id: item.id,
            route_name: item.route_name,
            route_date: item.route_date,
            driver_id: item.driver_id,
            driver_name: `Motorista ${item.driver_id?.substring(0, 5)}...`,
            created_at: item.created_at
        })) || [];
    return mappedData;
}
